import React from 'react';
import DevImg from '../Assets/developer-boy.png';

class Lead extends React.Component {
    constructor(props){
        super(props);
    }

    render () {
        return (
        <div className="w-100 p-3 p-sm-5 d-flex flex-column flex-sm-row-reverse justify-content-center align-items-sm-center" style={{backgroundColor: '#222831'}}>
            <img src={DevImg} alt="young developer image" className="w-100" />
            <div className="w-100 text-sm-start" style={{paddingBottom: 30}}>
                <h2 style={{opacity: '0.9', fontSize: 25, color: '#00ADB5'}}>Hello, Universe!</h2>
                <h1 style={{fontSize: 30, color:'#00ADB5'}}>I'm Goodness, a <span style={{textShadow:'2px 2px 2px #EEEEEE', fontWeight:'bold'}}>Frontend Developer</span></h1>
                <p style={{color: '#00ADB5', fontSize: 20}}>I build stunning and business evolving websites</p>
                <button className="btn rounded-4" style={{backgroundColor:'#EEEEEE', color:'#00ADB5', height: 40}}>Get in Touch</button>
            </div>
         </div>
        );
    }
}

export { Lead }
